import React from 'react';
import s from "./PriceSelect.module.css";

const PriceSelect = () => {
  return (
      <div className={s.template__price}>
        <span className={s.template__price_label}>Цена</span>
        <div className={s.template__price_inputs}>
          <input className={s.template__price_start} type="number" min={0} placeholder={'Цена от'}/>
          <input className={s.template__price_end} type="number" min={0} placeholder={'Цена до'}/>
        </div>
      </div>
  );
};

export default PriceSelect;
